'''96猫'''是[[niconico动画]]上活跃且人气非常高的多声类女性唱见。
== 个人介绍 ==

*96猫是[[niconico动画]]上一位高人气的多声类女性唱见。

*96猫星座白羊座/血型O型/身高143.2cm{{黑幕|加上鞋垫的全长160cm}}

*96猫主要翻唱[[VOCALOID]]歌曲和[[ACG]]歌曲。

*96猫有着极高的唱功、多变的声线、独特的演唱风格，并因此受到许多人的喜爱，拥有大量粉丝。

*96猫的二次设定是黄色短发、红色瞳孔{{黑幕|虽然身高只有一米四但在许多pv中被画得和一米七+的男唱见一样高}}

*96猫名字由来是她喜欢黑色，喜欢猫也喜欢黑猫。（96在日语中发音与{{ruby|黒|くろ}}相同）

*代表作有《[[诶？啊、嗦]]》、《[[千本樱]]》、《[[Blessing]]》和《[[俄罗斯套娃]]》等。

*首支出道单曲为2017年3月15日（水）贩售的[[人渣的本愿]]的OP《[[嘘の火花]]》。

